import React from 'react';

import Home from './views/Home';

import './assets/css/bootstrap.min.css';
import './assets/scss/now-ui-kit.scss';

const App = () => {
    return (
        <ConnectedRouter>
            <Switch>
                <Route path="/" exact component={Home} />
            </Switch>
        </ConnectedRouter>
    );
};

export default App;
